import React from "react";
import styled from "styled-components";
import Image from "../../image";
import {Button} from "../../../form/buttons/primary-button";
import { ContentWrapper, FlexContainer, CustomButton, ContentContainer, HeaderContainer, CenteredForm, FormContainer, InputContainer, Title, SubTitle } from "../../elements";
import colors from "../../../../theme/main/colors";
import { PhoneInput } from "../../../form/input-fields/phone-input";
import { DefaultInput } from "../../../form/input-fields/primary-input";
import Link from "next/link";

const LinkWithLine = styled("a")`
color:${colors.primary};
padding-left:5px;

}
`;

const InputContainerWithSpace = styled(InputContainer)`
padding-right:60px;
}
`;
const CustomFlexContainer = styled(FlexContainer)`
padding-bottom:0px;
}
`;

const LeftAlignedForm = styled(CenteredForm)`
top: 50%;
left: 75.5px;
transform: translate(0%, -50%);
}
`;

const BackButton = styled("img")`
padding-bottom:10px;
`;
const CustomHeaderContainer = styled(HeaderContainer)`
padding-bottom:40px;
}`;


const Signup = ({ handleNext, handleBack }) => {
    return (
        <>
            <ContentWrapper>
            <LeftAlignedForm>
                <CustomHeaderContainer>
                <BackButton onClick={handleBack} src={require("../../../../assets/icons/back-arrow.svg")} />
                    <Title>Vehicle Type</Title>
                    <SubTitle>Please select your vehicle type.</SubTitle>

                </CustomHeaderContainer>
                <ContentContainer>

                    <CustomFlexContainer>
                        <InputContainerWithSpace>
                            <DefaultInput
                                label="Company Name *"
                                placeholder="your company name"
                                id="companyname" />
                        </InputContainerWithSpace>

                        <InputContainer>
                            <DefaultInput
                                type="email"
                                label="Official Email Address *"
                                placeholder="your@company.com"
                                id="officialemail" />
                        </InputContainer>
                    </CustomFlexContainer>

                    <CustomFlexContainer>
                        <InputContainerWithSpace>
                            <PhoneInput
                                label="Phone Number *"
                                placeholder="your phone number"
                                id="phonenumber" />
                        </InputContainerWithSpace>

                        <InputContainer>
                            <DefaultInput
                                label="Number of Employees *"
                                placeholder=""
                                id="employeenumber" />
                        </InputContainer>
                    </CustomFlexContainer>

                    <Button onClick={handleNext}>
                        Continue
                    </Button>
                    <FlexContainer>
                        <SubTitle>Need help?</SubTitle>
                        <LinkWithLine href="/">Click here</LinkWithLine>

                    </FlexContainer>
                </ContentContainer>
            </LeftAlignedForm>
            </ContentWrapper>

        </>
    );
};

export default Signup;
